            <h3 className="aboutMe__subtitle">Виталий</h3>
            <p className="aboutMe__info">На курсе веб-разработки мы освоили технологии, которые применили в дипломном проекте.</p>
            <p className="aboutMe__text">На курсе веб-разработки мы освоили технологии, которые применили в дипломном проекте.</p>
            <ul className="aboutMe__info">
